(function ($) {
	$.each([
	
		'http://localhost/blog.cv/public/_styles.scss',
		// 'http://localhost/maye/mvc/public/css/style.scss',
		// 'http://localhost/maye/mvc/public/css/slider.scss',
		// 'http://localhost/maye/mvc/public/css/sprite.scss',
			
	], function (i, scss) {
		$.get(scss, function (s) {
			new Sass("http://localhost/blog.cv/public/scss-to-css/sass.worker.js").compile(s, function (s) {
				$("body").prepend($("<style />").text(s.text))
			})
		});
	});
})(jQuery)